  content: "";
  height: 100%;
  width: 200px;
  display: block;
  position: relative;
  border-radius: 50% 50% 50% 50% / 60% 60% 40% 40%;

}

&:before {
  left: 200px;
  top: 100px;
  box-shadow: -30px 0 40px -10px #60ec94;
  transform: skewX(-10deg);
}

&:after {
  left: 200px;
  top: -300px;
